import React, { useState, useEffect } from 'react';

function Result(props){

  const [result, setData] = useState("name");


  useEffect(() => {
    fetch('http://localhost:8080/?' + props.location.state, {method: 'GET'})
    .then(res => res.json())
    .then((data) => setData(data));
  }, []);

  return (
    <div>
      <p>{result}</p>
    </div>
  );
};

export default Result;
